import React from "react";
import Page1 from "./page1";
import Page2 from "./page2";
import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
  NavLink
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <NavLink />
      <BrowserRouter>
       <Routes>
        <Route exact path="/" component={Page1} />
        <Route path="/page2" component={Page2} />
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
